import Snake from "./Snake";
import Point from "./Point";

class WorldModel {
  private snake: Snake;

  constructor(s: Snake) {
    this.snake = s;
  }

  update(steps: number): void {
    this.snake.move(steps);
  }

  getSnake(): Snake {
    return this.snake;
  }

  setSnake(newSnake: Snake): void {
    this.snake = newSnake;
  }
}

export default WorldModel;
